INSERT INTO rhapsody_blog VALUES
    (NULL,'19.2.0','https://realta.co.id/hospitality-system/',NULL,79,'blog','com_content','Blog','blog',NULL,NULL,1,'{"category_layout":"","image":""}',NULL,NULL,'{"author":"","robots":""}','2018-09-06 14:51:05','0000-00-00 00:00:00',0,'*',1,'admin',1,NULL,351,'Super User','admin','realta@realta.co.id','$2y$10$Dj2PXXE.I7w62SFkS/r5/u3DgpHXI8wn6ZypRlAKjPW6C5giMdpGa',0,1,'2018-09-06 14:51:06','2021-05-18 10:40:34',0,NULL,'0000-00-00 00:00:00',0,NULL,NULL,0,'["Public","Super Users"]',NULL,82,'Objek Wisata di Indonesia yang Mendunia','objek-wisata-di-indonesia-yang-mendunia','<p style="text-align: justify;">Indonesia terkenal dengan wilayahnya yang luas dan masyarakatnya yang sangat ramah, ditambah dengan keindahan pemandangan yang terpampang di setiap jengkal negara Indonesia...</p>','<p style="text-align: justify;">Indonesia terkenal dengan wilayahnya yang luas dan masyarakatnya yang sangat ramah, ditambah dengan keindahan pemandangan yang terpampang di setiap jengkal negara Indonesia. Salah seorang jurnalis asal Bulgaria yang juga seorang penulis, Magdalena Gigova, dalam bukunya bertajuk <em>Indonesia In The Eyes of Bulgaria </em>menulis “Saya terpana dengan tradisi Jawa, saya kagum dengan keindahan Bali, dan saya senang dengan keramahan masyarakat Indonesia.”</p>
<p style="text-align: justify;">Maka tidak heran pada tahun 2017 lalu, negara kita didatangi sebanyak 14 juta turis asing dari seluruh dunia untuk menghabiskan liburannya di Indonesia. Kemana saja mereka? Apakah ada objek wisata di Indonesia yang sudah mendunia?</p>
<p style="text-align: justify;">Berikut kami berikan informasi kepada kamu, objek wisata di Indonesia yang mendunia :</p>
<p style="text-align: justify;"> </p>
<h2 style="text-align: justify;"><strong>Raja Ampat </strong></h2>
<p style="text-align: justify;">Indonesia adalah negara kepulauan, sehingga keindahan laut dan pantai banyak terdapat di setiap wilayah di Indonesia. Salah satunya adalah Raja Ampat. Jika kamu mengunjungi tempat ini, kamu akan dimanjakan dengan keeksotisan Papua yang sangat mendamaikan hati. Aktivitas yang bisa kamu lakukan di Raja Ampat mulai dari Diving, snorkeling, berlayar memancing, dan wisata kuliner.</p>
<p style="text-align: justify;">Keindahan dasar laut Raja Ampat sudah tidak perlu diragukan lagi, sedikitnya ada 537 spesies koral dan 699 hewan bertulang belakang  yang dapat kamu jumpai saat kamu mengeksplor keindahan bawah laut Raja Ampat.</p>
<h2 style="text-align: justify;"><strong>Bali</strong></h2>
<p style="text-align: justify;">Pulau Bali, mungkin sudah sangat familiar, dan memang pulau ini menjadi salah satu objek wisata dari Indonesia yang mendunia. Banyak hal yang bisa kamu lakukan di pulau yang mempunyai nama lain pulau dewata ini, salah satunya dengan menikmati keindahan pantai yang sangat terkenal dengan ombaknya, cocok untuk kamu yang ingin mencoba olahraga surfing.</p>
<p style="text-align: justify;">Atau kamu ingin lebih kepada wisata tradisional, beberapa travel disana menyiapkan beberapa jenis tur diantaranya adalah  wisata musik dan upacara adat. Kamu akan dikenalkan Bali dari sisi lainnya, misalnya  ke Pura tempat sembahyang masyarakat Hindu disana, atau kamu dibawa ke sebuah paguyuban musik dan budaya tradisional  Bali untuk memperkenalkan budaya asli Bali yang masih dilestarikan sampai sekarang.</p>
<p style="text-align: justify;"> </p>
<h2 style="text-align: justify;"><strong>Gunung Bromo</strong></h2>
<p style="text-align: justify;">Dari Bali kita berpindah ke wilayah timur Jawa, ke daerah Malang, disana ada objek wisata gunung yang sangat diminati turis luar dan dalam negeri, gunung tersebut bernama Gunung Bromo. Memiliki ketinggian 2.392 mdpl sebetulnya ada 4 kawasan wilayah di Jawa Timur yakni Pasuruan, Lumajang, Malang dan Probolinggo yang masuk dalam kawasan gunung Bromo. Bentuk Gunung Bromo sangat lah indah, bertautan dengan lembah dan ngarai serta lautan pasir yang terbentang seluar 10 KM persegi. Kamu pastinya akan dimanjakan dengan kesejukan udara pegunungan dan kedamaian susana gunung yang dapat membuat kamu pastinya tidak ingin buru-buru pulang.</p>
<p style="text-align: justify;"> </p>
<h2 style="text-align: justify;"><strong>Pulau Komodo</strong></h2>
<p style="text-align: justify;">Pulau Komodo masuk  ke dalam situs warisan dunia yang ditetapkan oleh UNESCO pada tahun 1986. Terletak di wilayah kepulauan Nusa Tenggara, Pulau Komodo merupakan  tempat untuk habitat spesies Komodo yang dilindungi dunia.</p>
<p style="text-align: justify;">Pulau Komodo pernah masuk ke dalam 7 keajaiban dunia (Seven Wonders of Nature) pada tahun 2011. Ada banyak yang bisa kamu lakukan dan nikmati di pulau Komodo ini. Selain melihat Komodo dari dekat, kamu juga dapat mengeksplorasi pantai pink yang melegenda. Untuk kamu yang sangat suka fotografi, setiap jengkal di Pulau Komodo sangatlah indah, sehingga kamu tidak akan kehabisan spot untuk mendapatkan hasil foto yang maksimal.</p>
<p style="text-align: justify;"> </p>
<p style="text-align: justify;">Tidak perlu mencari objek wisata sampai luar negeri bila di negara kita sendiri banyak objek wisata yang tidak kalah dengan apa yang ditawarkan negara-negara lain. Kita harus berbangga dengan kekayaan tempat-tempat indah yang ada di negara kita, sehingga sebelum keluar negeri ada baiknya kamu prioritaskan untuk mengunjungi objek-objek wisata di Indonesia. Salam Indonesia! Salam <a href="../">Realta!</a> <strong><em>(Abn)</em></strong></p>
<p style="text-align: justify;"> </p>
